import React from "react";

const Footer = () => {
    return(
        <>
        <br></br>
        <footer className="bg-light text-center">
        <p>&copy; 2023 Siddhant Roy. All rights reserved.</p>
        <p>This website offers meticulously crafted Handwritten IT/Computer Science Engineering Notes, providing a comprehensive and enjoyable study resource to excel in exams and enhance understanding of key topics in the field. Based on MU syllabus</p>
        </footer>
        </>
    )
}

export default Footer;
